import React, { useState } from "react";

import { TextField } from '@material-ui/core';

const InputSearch = () => {
    const [ value, setValue ] = useState('');

    const handleChange = ({ target }) => {
        setValue(target.value)
    }

    return (
        <diw>
            <TextField
                id="outlined-name"
                label="Search img"
                value={ value }
                onChange={ handleChange }
                variant="outlined"
            />
        </diw>
    )
}

export default InputSearch;
